import './App.css';
import { useSelector, useDispatch } from 'react-redux';

import Card from './UI/Card/Card';
// import Login from './Components/Login/Login';
import Header from './Components/Header/Header';
import { fnameUpdater, lnameUpdater, selectLname, selectFname } from './slices/userDetailsSlice';
import ProductList from './Components/ViewProducts/ProductList';
import NewProduct from './Components/NewProduct/NewProduct';

const DUMMY_PRODUCT = [
  {
  id: 1,
  prod_name: 'kopiko',
  price: 7,
  stock: 50,
  },
  {
    id: 2,
    prod_name: 'marlboro',
    price: 5,
    stock: 50,
  },

];

function App() {
  const userDetail = {
    fn: useSelector(selectFname),
    ln: useSelector(selectLname),
  };

  // console.log(userDetail.fn);
  // console.log(userDetail.ln);

  return (
    <div>
    <Header/>
    <Card>
      <Router>
       {/* <Login/>  */}
      <ProductList products={DUMMY_PRODUCT}/>
      </Router>
    </Card>

    <NewProduct/>
    </div>
  );
}

export default App;
